import React from "react";
import '../../styles/Manage/UsersList.css';
import logo from '../../images/user.jpg';
import serverPath from "../../utilis/server-path";

export default class Userlist extends React.Component {

    constructor(props) {
        super(props);
    }

    async getData() {
        try {
            const resp = await fetch(serverPath() + 'api/Users/?page=0', {
                headers: {
                    'Access-Control-Allow-Origin': '*'
                },
                credentials: 'include'
            }).catch(e => e.json()).catch(null)


        } catch (e) {

        }
    }

    renderData() {
        const tab = []
        for (let i = 0; i < 25; i++) {
            tab.push(
                <tr>
                    <th>
                        <a>{i}</a>
                    </th>
                    <th>
                        <div className={'User_list_view_mian_body_table_image_user'}>
                            <div className={'User_list_view_mian_body_table_image_user_img'}>
                                <img src={logo}/>
                            </div>
                            <a>Michał Ratajewski</a>
                        </div>
                    </th>
                    <th>
                        <a>Administrator</a>
                    </th>
                    <th>
                        <button>
                            Edytuj
                        </button>
                        <button>
                            Usuń
                        </button>
                    </th>
                </tr>
            )
        }
        return tab
    }

    render() {
        return (
            <div className={'User_list_view_mian'}>
               <div className={'User_list_view_headbar'}>
                   <h1>Użytkownicy</h1>
               </div>
                <div className={'User_list_view_mian_body'}>
                    <table className={'User_list_view_mian_body_table'}>
                        {/*<colgroup>*/}
                        {/*    <col span="1" style={{width: "460px"}}/>*/}
                        {/*    <col span="1" style={{width: "140px"}}/>*/}
                        {/*</colgroup>*/}
                        <thead>
                            <tr >
                                <th style={{width: '5%', whiteSpace: 'nowrap'}} >ID</th>
                                <th >Nazwa</th>
                                <th style={{width: '200px'}}>Typ</th>
                                <th style={{width: '300px'}}/>
                            </tr>
                        </thead>
                        <tbody>
                        {
                            this.renderData()
                        }
                        </tbody>

                    </table>
                </div>
            </div>
        )
    }

}
